    false,nt"url": null,nt"notes": "This report presents the results of a goose
    production study at Fish Springs National Wildlife Refuge. The objectives of this
    study were; 1) determine the reproductive success of the breeding population including
    average clutch and brood size, total hatched and fledged, 2) determine areas/types
    of nest sites selected and the reproducitve success pertaining to these sites, 3)
    determine site utilization for feeding, loafing, brood rearing throughout the reproductive
    season, and 4) determine the feasibility of a continued goose hunting season, in
    relation to its impact on the breeding population.",nt"license_title": "License
